import React from 'react';

function Tile(props) {

  function poner_foto(symbol){
    if (symbol === "cacao seco"){
      return require("../imgs/cacao.png");
    }
    if (symbol === "cacao"){
      return require("../imgs/cacao.png");
    }

    if (symbol === "chocolate"){
      return "../imgs/chocolate-bar.png";
    }

  }
    return (
      <section className="Tile">
        <p id="p_tile">{props.symbol}</p>
        <img src={require("../imgs/chocolate-bar.png")} alt="img" className='img_tile'></img>

      </section>
    );
  }

  export default Tile;
